import React, { Component } from "react";
import "./App.css";

class Title extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { text } = this.props;
    return (
      <div className="titleContainer">
        <div className="titleWrapper">
          <h2>{text}</h2>
        </div>
        <div className="titleWrapper cloneWrapper">
          <h2>{text}</h2>
        </div>

      </div>
    );
  }
}

export default Title;
